import React from "react";

import './bstest.css';
import { useNavigate } from 'react-router-dom';

const BSTest = () => {
  const navigate = useNavigate();

  function handleAdd(e) {
    e.preventDefault();
    console.log(e.target.email.value);

    if (!e.target.email.value) {
      alert("You have succesfully added QTY of Ticker @ Price");
    } 
    else if (!e.target.email.value) {
      alert("Valid email is required");
    } 
    else if (!e.target.password.value) {
      alert("Password is required");
    } 
    else if (
      e.target.email.value === "me@example.com" &&
      e.target.password.value === "123456"
    ) {
      alert("Successfully logged in");
           
    } 
    else {
      alert("Wrong email or password combination");
    }
  };

  function handleMinus (e){
    e.preventDefault();
    alert("You have succesfully removed QTY of Ticker @ Price");
  };

  // function handleSearch(e){
  //   e.preventDefault();
  //   alert("Searching Ticker / Company Name");
  // };


    return (
      <div className="Login">
         <form className="form" onSubmit={handleAdd}>
         
         <div className="input-group">
            <label htmlFor="ticker">Ticker </label>
            <input type="ticker" name="ticker" placeholder='Example: AAPL, TSLA'/>
          </div>
          
          <div className="input-group">
            <label htmlFor="Country">Country </label>
            <input type="country" name="country" placeholder='USD or SGD only' />
          </div>        
          
          {/* <button className="secondary" onClick={handleSearch}>
          Search
        </button> */}

          <div className="input-group">
            <label htmlFor="quantity">Quantity </label>
            <input type="quantity" name="quantity" placeholder='Numerical values only'/>
          </div>
          
          <div className="input-group">
            <label htmlFor="cost">Cost </label>
            <input type="cost" name="cost" placeholder='Numerical values only'/>
          </div>
         
          <button className="primary">
            Update - Add
            </button>

          <button className="secondary" onClick={handleAdd}>
          Update - Add
          </button>
          
          <button className="secondary" onClick={handleMinus}>
          Update - Minus
          </button>

        </form>
       
      </div>
    );
  
}

export default BSTest;
